import React from 'react'
import axios from 'axios'
const AllProducts = (props) => {
  let allProducts = { props }
  console.log(allProducts)
  return (
    <div>
      <h2>All products</h2>
      {AllProducts.map((product, i) => (
        <p key={i}>{product.title}</p>
      ))}
    </div>
  )
}

export default AllProducts
